import React from 'react';

const AboutUs = () => {
  return (
    <div style={{ padding: '50px', background: '#f9f9f9' }}>
      <h2>Hakkımızda</h2>
      <p>
        Dream Home Finder, en iyi evleri bulmanıza yardımcı olmak için burada. Emlak arama deneyiminizi kolaylaştırmak ve kişiselleştirmek için tasarlandı.
        Sunduğumuz geniş yelpazedeki seçenekler ve kullanıcı dostu arayüzümüzle, hayalinizdeki evi bulmanız artık çok daha kolay.
      </p>
    </div>
  );
};

export default AboutUs;
